(1, 'Inventario de Aceites y Subproductos', 'Select  \r\nIdCertificado,\r\n\'<a href=\"app_detalles.php?idCer=\' +  CONVERT(varchar(50), IdCertificado) + \'&tipo=\' + CONVERT(varchar(50), IdTipoDeInventario) +  \'&back=13\"  class=\"icon\"><img src=\"icon/info.png\"></a> \' as Info,\r\n\'<a href=\"app_vender.php?idCer=\' +  CONVERT(varchar(50), IdCertificado) + \'&tipo=\' + CONVERT(varchar(50), IdTipoDeInventario) +  \'&back=13\"  class=\"icon\"><img src=\"icon/check3.png\"></a> \' as Vender,\r\nISNULL(Fruta, \'\') as Fruta,\r\nISNULL(FechaProduccion,\'\') as FechaProduccion,\r\nISNULL(LoteNum, \'\') as LoteNum,\r\nISNULL(Envasado, \'\') as Envasado,\r\nISNULL(Produccion, 0) as Produccion,\r\nISNULL(Retorno, 0) as Retorno,\r\nISNULL(Sobrantes, 0) as Sobrantes,\r\nISNULL(Vendido, 0) as Vendido,\r\nISNULL(Ofertado, 0) as Ofertado,\r\nISNULL(Disponibilidad, 0) as Disponibilidad,\r\nISNULL(TiempoAlmacen, 0) as TiempoAlmacen,\r\nISNULL(KgTambor,0) as KgTambor,\r\nISNULL(TotalKgTambor, 0) as TotalKgTambor\r\nfrom InventariosPrincipales(\'Kilogramos\', 1 ) Where IdTipoDeInventario = 9', '', '', 'Lista de Productos Aceites', 'root', '2020-10-13', '20:00:07', 'L', 2, 'root', 2, '0', 1, 0, 'text', '', 0, 'text', '', 0, 'text', '', '', '', '', '', 1, 1, 1, 4, 0, 1),
(25, 'Contenido del Silo 5', 'SELECT Formato As Tipo, IdCertificado, LoteNum, Fecha, InGall, Brix, BrixRed, Factor, Ps, Ratio, Acid, Oil, Color, N, Defects, Flavor, Score, PorcPulpa, Ph, Porcpww, PorcAire, \r\n                      VitaminaC, PorcHow, Visc\r\nFROM         dbo.f_DetalleDeUnSilo(5)\r\nORDER BY Formato, CONVERT(datetime, SUBSTRING(Fecha, 4, 2) + \'/\' + SUBSTRING(Fecha, 1, 2) + \'/\' + SUBSTRING(Fecha, 7, 4)) DESC\r\n', '', '', 'Historial de Silo(s)', 'root', '2020-10-13', '20:00:07', 'L', 1, 'root', 2, '0', 1, 0, 'text', '', 0, 'text', '', 0, 'text', '', '', '', '', '', 1, 1, 1, 4, 0, 0),
(26, 'Contenido del Silo 6', 'SELECT Formato As Tipo, IdCertificado, LoteNum, Fecha, InGall, Brix, BrixRed, Factor, Ps, Ratio, Acid, Oil, Color, N, Defects, Flavor, Score, PorcPulpa, Ph, Porcpww, PorcAire, \r\n                      VitaminaC, PorcHow, Visc\r\nFROM         dbo.f_DetalleDeUnSilo(6)\r\nORDER BY Formato, CONVERT(datetime, SUBSTRING(Fecha, 4, 2) + \'/\' + SUBSTRING(Fecha, 1, 2) + \'/\' + SUBSTRING(Fecha, 7, 4)) DESC\r\n', '', '', 'Historial de Silo(s)', 'root', '2020-10-13', '20:00:07', 'L', 1, 'root', 2, '0', 1, 0, 'text', '', 0, 'text', '', 0, 'text', '', '', '', '', '', 1, 1, 1, 4, 0, 0),
